description:
Tera is determined to go out on top of the fashion model circuit. But she's surrounded by people dead set on bringing her down. Bitchy designers, luscious hard-body girls eager to take her place, fashion editors looking for the latest scandal to sell their magazines and news shows. But her biggest worry is the ex-partner who's returned from prison. Not knowing what he's looking for or who he is out to fuck this time, she's doing her best to avoid him. She just wants to make a clean break from being the beautiful object of desire on the runway. And she's willing to put her ass on the line to do it.

